import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
class OfferDetail extends Component {

    componentDidMount() {
        window.scrollTo(0, 0)
      }

    render() {
        return (
            <div>
                <div className="offer-page section-padding">
                    <div className="container">
                        <div className="row text-center">
                            <div className="col-md-12">
                                <h2 className="h2-heading text-pink">Looks Salon</h2>
                                <img src="./images/looks-salon-logo.svg" alt="" className="offer-logo"  />
                                <h2 className="h2-heading mt-4">50% off on Hair Cutting</h2>
                                <p>Branch: Janakpuri Delhi</p>
                                <Link to="#" className="btn btn-pink">Redeem Offer</Link>

                                <hr />
                                <h3>Terms & Conditions</h3>
                                <p>
                                    Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.
                                </p>

                            </div>
                        </div>
                    </div>
                </div>

            </div>
        )
    }
}

export default OfferDetail;
